        {id:"X",src:"https://s3.amazonaws.com/freecodecamp/drums/RP4_KICK_1.mp3",name:"Kick"},
        {id:"C",src:"https://s3.amazonaws.com/freecodecamp/drums/Cev_H2.mp3",name:"Closed-HH"},
    ]})
    return ( 
        <div>
            <Drum audios={audio.audios} />
        </div>
     );
}
 
export default App;
